import React from "react";
import logo from "../../public/content/SVG/Asset 2.svg";
import "./Nav.css";

function Nav() {
  return (
    <div className="nav">
      <div className="logo">
        <img src={logo} alt="ABURA-logo" className="logoImg"></img>
      </div>
    </div>
  );
}

export default Nav;
